law.text:
As used in KRS 211.651 to 211.670, unless the context otherwise requires:
"Cabinet" means the Cabinet for Health and Family Services;
"Secretary" means the secretary of the Cabinet for Health and Family Services;
"Department" means the Department for Public Health; and
"Designee" means a local health department, board for mental health or individuals with an intellectual disability, or other governmental or private agency designated by the Department for Public Health.
